import * as React from 'react'
import { Pages } from '../../models'
import { LoginProvidersData } from '@flashcards/client'

function Login() {
  return (
    <main>
      <h1>Login</h1>
      {Object.keys(LoginProvidersData).map(provider => (
        <button key={provider}>{provider}</button>
      ))}
    </main>
  )
}

Login.displayName = Pages.Login

export { Login }
